import React from "react";
import { Link } from "react-router-dom";

function CultoPage() {
  return (
    <div id="culto-page">
      <main>
        <h2>Culto de Domingo</h2>
        <input type="text"/>
        <input type="text"/>
        <Link to="" className="confirm">Inscrever-se</Link>
        <Link to="" className="cancel">Voltar</Link>
      </main>
    </div>
  );
}

export default CultoPage;
